import axios from "axios";

async function login(email: string, password: string){
    try {
    const { status } = await axios.post("/api/login", {email, password})
    console.log(status)
    }catch(error){

    }

}

async function register(username: string, email: string, password: string | null){
    try {
    const { status } = await axios.post("/api/register", {username, email, password})
    console.log(status)
    }catch(error){

    }

}

export {
    login,
    register
}
